const Todo = (props) => {
    return (
        <li className="list-group-item">
            <input type="checkbox" id={'t'+props.id} checked={props.tache.faite} onChange={() => props.onCheck(props.tache)} />{' '}
            <label htmlFor={'t'+props.id} className="mb-0">{props.tache.intitule}</label>
        </li>
    )
}

export default Todo;
